    data: |
      SELECT DISTINCT * FROM tab0 (FORMAT parquet) AS cor0 WHERE cor0.col0 * + col2 NOT IN ( col0 + + col1 ) OR NULL IN ( col1 * - col0 + col2 );
  - name: tab0

outputs:
